Detector::Rect Cluster::getTrackingROI(float searchFactor, Detector::Rect validROI)
{
	Detector::Rect searchRegion = blobROI*(searchFactor);
	//check
	if (searchRegion.upper+searchRegion.height > 480.0f)
		searchRegion.height = validROI.height-searchRegion.upper;
	if (searchRegion.left+searchRegion.width > 640.0f)
		searchRegion.width = validROI.width-searchRegion.left;

	return searchRegion;
}

/* Given a 3D point [X Y Z]', the projection (x, y) 
 * of the point onto the rectified image is given by:
 *  [u v w]' = P * [X Y Z 1]'
 *         x = u / w
 *         y = v / w
 *
 * With 2D point we can produce 2d rgb image - blob of a cluster.
 * This blob is later used for HOG confidence evaluation.
 */
void Cluster::produceRGBBlob(const sensor_msgs::CameraInfoConstPtr& camInfo, const sensor_msgs::ImageConstPtr& image){
	std::cout << "Produce RGB blob" << std::endl;	
  image_geometry::PinholeCameraModel cam_model_;
  cam_model_.fromCameraInfo(camInfo);
  cv::Point2d *uv = new cv::Point2d();
  cv::Mat *img = new cv::Mat(cv::Mat::zeros(480, 640, CV_8UC3));
	cv::Mat *dst = new cv::Mat(cv::Mat::zeros(480, 640, CV_8UC3));
	cv::Mat *dst2 = new cv::Mat(cv::Mat::zeros(480, 640, CV_8UC3));
	cv::Mat *imgROI;
	cv::Mat *resized = new cv::Mat(cv::Mat::zeros(480, 640, CV_8UC3));
  cv::Vec3b *v = new cv::Vec3b(255,255,255); 
  int maxY = -100;
	int minY = 1000;
	int maxX = -100;
	int minX = 1000;
  // Iterate through every pixel in 3d cluster and project
  // (x,y,z) voxel coordinate to 2D (x,y) coordinate using intrinsic 
  // parameters of kinect camera. Assign that pixel white color. 
  // We will extract true color from original RGB image later
  // get minimum and maximum values to adjust the size of the image to blob size
	std::cout << "Produce RGB blob 1" << std::endl;	
	for (int i = 0; i < cloud_cluster->points.size(); i++) {
    cv::Point3d pt_cv(cloud_cluster->points[i].x, cloud_cluster->points[i].y, cloud_cluster->points[i].z);
    cam_model_.project3dToPixel(pt_cv, *uv);   
    img->at<cv::Vec3b>((int)uv->y, (int)uv->x) = (*v); 
    minX = min(minX, (int)uv->x);
    minY = min(minY, (int)uv->y);
    maxX = max(maxX, (int)uv->x);
    maxY = max(maxY, (int)uv->y);    
  }
  std::cout << "Produce RGB blob 2" << std::endl;	
  //set roi to later crop image to get POI
	
	if(maxX > 640.0)
		maxX = 640.0f;
	if(maxY > 480)
		maxY = 480.0f;

  cv::Rect myROI(minX, minY, (maxX - minX), (maxY - minY));
	//std::cout << minX <<" "<< minY << " " << maxX << " " << maxY << std::endl;
	blobROI.upper = minY;
	blobROI.left = minX;
	blobROI.height = (maxY - minY);
	blobROI.width = (maxX - minX);

	//std::cout << "Nastavitev parametrov za dilate-erode" << std::endl;
  cv::Mat Kernel(cv::Size(3, 3), CV_8UC1);
	cv::Mat Kernel2(cv::Size(2, 2), CV_8UC1);
	Kernel.setTo(cv::Scalar(1));
	Kernel2.setTo(cv::Scalar(1));
  //cv::dilate(*img, *dst, Kernel, cv::Point(-1,-1), 10);
	//cv::erode(*dst, *dst, Kernel2, cv::Point(-1,-1), 4);

	int dilation_size = 12;
	int erosion_size = 9;
	
  Mat element = getStructuringElement(MORPH_RECT,
                                       cv::Size( 2*dilation_size + 1, 2*dilation_size+1 ),
                                       Point( dilation_size, dilation_size ) );

	std::cout << "Začetek dilate" << std::endl;
  dilate(*img, *dst2, element );
  element = getStructuringElement(MORPH_RECT,
                                       cv::Size( 2*erosion_size + 1, 2*erosion_size+1 ),
                                       Point( erosion_size, erosion_size ) );

  /// Apply the erosion operation
	std::cout << "Začetek erode" << std::endl;
  erode(*dst2, *dst, element );	
	//std::cout << "OK erode" << std::endl;
	//Copy original ROS rgb image to CV image for further processing
  try{
    cv_ptr = cv_bridge::toCvCopy(image, image->encoding);
  }
  catch (cv_bridge::Exception& e){
    ROS_ERROR("cv_bridge exception: %s", e.what());
  }  

  // Iterate through all rows and columns in dilated blob
  // Extract coordinates of each blob pixel to get rgb value 
  // from original rgb image at that coordinate.
  // Asign each blob pixel obtained rgb value and crop image
  // according to true width and height.
	//std::cout << "		Starting to copy RGB points" << std::endl;
	
  for(int i = 0; i < dst->rows; i++) {
        for(int j=0; j < dst->cols; j++) {
          if(dst->at<cv::Vec3b>(i,j) == *v)
		        dst->at<cv::Vec3b>(i,j) = cv_ptr->image.at<cv::Vec3b>(i,j);
      		}
    }
	try{
		imgROI = new cv::Mat((*dst)(myROI));
	}
	catch( cv::Exception& e ){
		//std::cout << e.what() << std::endl;
		imgROI = new cv::Mat(*dst);	
		}

  /*Blob size according to SVM learning imgs*/
  int w,h, width=64, height=128;
  
  /*Crop the image to the right size*/
  float src_aspect = 1.0*imgROI->cols/imgROI->rows;
  float aspect = 1.0*width/height;
  if( src_aspect < aspect ) {
    h = height;
    w = (int)(height*src_aspect);
  } else {
    w = width;
    h = (int)(width/src_aspect);
  }

  cv::resize(*imgROI, *resized,cv::Size(w,h));

  //Fill blob img with black color
  blob = new cv::Mat(cv::Mat::zeros(128, 64, CV_8UC3));	
  for(int i = 0; i < resized->rows; i++) {
     for(int j=0; j < resized->cols; j++) {
			blob->at<cv::Vec3b>(i,j) = resized->at<cv::Vec3b>(i,j);
		 }
	}
	delete img;
	delete dst;
	delete dst2;
  delete v;
	delete uv;
	delete imgROI;
	delete resized;
}


/*Calculate HOG Confidence of Cluster*/
void Cluster::CalculateConfidence(void){
	/*OpenCV HOG function*/
	cv::HOGDescriptor hog;
	hog.gammaCorrection = 1;
  hog.setSVMDetector(cv::HOGDescriptor::getDefaultPeopleDetector());
	//hog.setSVMDetector(getThisPeopleDetector2);
	vector<cv::Point> found;
	//vector<cv::Rect> found;
	vector<double> hitsWeights;
	hog.detect(*blob, found, hitsWeights, HOG_THRESHOLD, cv::Size(8,8), cv::Size(32,32));
	//hog.detectMultiScale(*blob, found, HOG_THRESHOLD, cv::Size(8, 8), cv::Size(32, 32), 1.05, 2);
	
	//Ce detectMultiScale
	/*if(found.size() > 0)
		confidence = 0.0;*/

  //Ce je samo hog.detect
  for (vector<double>::size_type i = 0; i < hitsWeights.size(); i++){
		//std::cout << hitsWeights[i] << std::endl;
    confidence = max(confidence, hitsWeights[i]); 
	}
    
  //std::cout << confidence << std::endl;
	//if(confidence >= HOG_THRESHOLD){
  	//ShowBlobInWindow();
	//}
	
  
  
}

