/* Visualization msgs for bounding box of a cluster
 * http://www.pcl-users.org/clustering-and-a-bounding-box-td3905570.html 
 */
visualization_msgs::Marker Cluster::Mark_cluster(void){
  Eigen::Vector4f centroid;
  Eigen::Vector4f min;
  Eigen::Vector4f max;
 
  pcl::compute3DCentroid (*cloud_cluster, centroid);
  pcl::getMinMax3D (*cloud_cluster, min, max);
 
  uint32_t shape = visualization_msgs::Marker::CUBE;
  //marker.header.frame_id = "camera_depth_optical_frame";
  //marker.header.stamp = ros::Time::now();
 
  //marker.ns = ns;
  boundingBox->id = 1;
  boundingBox->type = shape;
  boundingBox->action = visualization_msgs::Marker::ADD;
 
  boundingBox->pose.position.x = centroid[0];
  boundingBox->pose.position.y = centroid[1];
  boundingBox->pose.position.z = centroid[2];
  boundingBox->pose.orientation.x = 0.0;
  boundingBox->pose.orientation.y = 0.0;
  boundingBox->pose.orientation.z = 0.0;
  boundingBox->pose.orientation.w = 1.0;
 
  boundingBox->scale.x = (max[0]-min[0]);
  boundingBox->scale.y = (max[1]-min[1]);
  boundingBox->scale.z = (max[2]-min[2]);
 
  if (boundingBox->scale.x ==0)
      boundingBox->scale.x=0.1;

  if (boundingBox->scale.y ==0)
    boundingBox->scale.y=0.1;

  if (boundingBox->scale.z ==0)
    boundingBox->scale.z=0.1;
   
  boundingBox->color.r = 100;
  boundingBox->color.g = 49;
  boundingBox->color.b = 237;
  boundingBox->color.a = 0.5;

  //marker.lifetime = ros::Duration();
  boundingBox->lifetime = ros::Duration(0.5);

  return *boundingBox;
} 

